import { NavLink, Link } from "react-router-dom";
import img from "../slike/logo.png";

const Navbar = () => {
  return (
    <div className="h-[80px] top-0 left-0 w-screen absolute bg-yellow text-black lg:relative lg:w-[250px] lg:h-screen"></div>
  );
};

export default Navbar;
